mapper.select:
select 

from POSIdentity
where szPOSItemID = #{szPOSItemID,jdbcType=VARCHAR}
  and lRetailStoreID = #{lRetailStoreID,jdbcType=INTEGER}

mapper.delete:
delete from POSIdentity
where szPOSItemID = #{szPOSItemID,jdbcType=VARCHAR}
  and lRetailStoreID = #{lRetailStoreID,jdbcType=INTEGER}
